import React, { useState } from "react";
import Account from "./Routes/Account";
import Pages from "./Routes/Pages";

const App = () => {

  const [account, setAccount] = useState(true);

  return (
    <>
    {account ? <Account/> : <Pages/>}
      <Account />
      <Pages />
    </>
  );
};

export default App;
